import './App.css';

import React from 'react';

function App() {
  return (
    <div>
      <h1>Witaj na mojej stronie!</h1>
      <p>Tutaj możesz umieścić swoją treść.</p>
      <ul>
        <li>Element listy 1</li>
        <li>Element listy 2</li>
        <li>Element listy 3</li>
      </ul>
    </div>
  );
}

export default App;
